import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './Navbar';
import Footer from './Footer';
import LandingPage from './LandingPage';
import AboutPage from './AboutPage';
import ContactPage from './ContactPage';
import SignUpPage from './SignUpPage';
import LoginPage from './LoginPage';
import TenantDashboard from './TenantDashboard'; // Tenant Dashboard
import OwnerDashboard from './OwnerDashboard';   // Owner Dashboard

function App() {
    const token = localStorage.getItem('token'); // Get token to check if user is logged in
    const user = JSON.parse(localStorage.getItem('user')); // Get user details from localStorage

    return (
        <Router>
            <div className="min-h-screen flex flex-col">
                <Navbar />  {/* Navbar will update dynamically based on login status */}
                <div className="flex-grow">
                    <Routes>
                        <Route path="/" element={<LandingPage />} />
                        <Route path="/about" element={<AboutPage />} />
                        <Route path="/contact" element={<ContactPage />} />
                        <Route path="/signup" element={<SignUpPage />} />
                        <Route path="/login" element={<LoginPage />} />

                        {/* Tenant Dashboard Route */}
                        {token && user?.userType === 'tenant' && (
                            <Route path="/tenant-dashboard" element={<TenantDashboard />} />
                        )}

                        {/* Owner Dashboard Route */}
                        {token && user?.userType === 'owner' && (
                            <Route path="/owner-dashboard" element={<OwnerDashboard />} />
                        )}

                        {/* Default route if token is not found */}
                        <Route path="*" element={<LoginPage />} />
                    </Routes>
                </div>
                <Footer />
            </div>
        </Router>
    );
}

export default App;
